<span class="line"><span style="color:#E1E4E8;">    </span><span style="color:#6A737D;"># 检查下embedding设置的是否合法，因为这里有了多头注意力机制之后，我们要保证我们的embedding维度 = att_head_nums * att_embedding_size</span></span>
