<span class="line"><span style="color:#24292E;">    self_attention </span><span style="color:#D73A49;">=</span><span style="color:#24292E;"> Transformer(singlehead_emb_size, att_head_nums, </span><span style="color:#E36209;">dropout_rate</span><span style="color:#D73A49;">=</span><span style="color:#005CC5;">0</span><span style="color:#24292E;">, </span><span style="color:#E36209;">use_layer_norm</span><span style="color:#D73A49;">=</span><span style="color:#005CC5;">True</span><span style="color:#24292E;">,</span></span>
