<span class="line"><span style="color:#24292E;">    dnn_logits </span><span style="color:#D73A49;">=</span><span style="color:#24292E;"> get_dnn_logits(deep_input, </span><span style="color:#E36209;">activation</span><span style="color:#D73A49;">=</span><span style="color:#032F62;">&#39;prelu&#39;</span><span style="color:#24292E;">)</span></span>
